    <style>
        body {
            font-family: 'Arial', sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
            height: 100vh;
            margin: 0;
            padding: 0;
            background-image: url('https://telegra.ph/file/0ab95965338bd2511c3a3.jpg');
            background-size: cover;
            background-position: center;
            position: relative;
            overflow: hidden;
        }

        #overlay {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-color: rgba(0, 0, 0, 0.5);
        }

        #loading {
            display: block;
            width: 50px;
            height: 50px;
            border: 5px solid #00bcd4;
            border-top: 5px solid #ffffff;
            border-radius: 50%;
            animation: spin 2s linear infinite;
            margin-bottom: 20px;
            z-index: 1;
        }

        img {
            width: 300px;
            height: 300px;
            border: 5px solid #00bcd4;
            border-radius: 10px;
            display: none;
            z-index: 2;
        }

        p {
            font-size: 24px;
            color: #ffffff;
            text-align: center;
            opacity: 0;
            animation: fadeIn 1s ease-out 4s forwards;
            margin-top: 20px;
            font-weight: bold;
            z-index: 2;
            text-shadow: 40px 50px 100px rgba(0, 0, 0, 0.9), 2px 2px 4px rgba(0, 0, 0, 0.9);
            cursor: pointer;
            display: none;
        }

        @keyframes spin {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
        }

        @keyframes fadeIn {
            0% { opacity: 0; }
            100% { opacity: 1; }
        }

        #reloadButton {
            background-color: #00bcd4;
            color: #ffffff;
            padding: 10px 20px;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            font-size: 16px;
            display: none;
        }

        #reloadButton:hover {
            background-color: #0097a7;
        }
        
        #informationBar {
            background: rgba(144, 144, 145, 0.7); 
        }
